	'{"entry":[{"id":"399542463434098","changes":[{"field":"feed","value":{"verb":"edited","published":1,"photo_id":1066494676738870,"sender_id":1449812980,"message":"El peque\u00f1o comercio de toda la vida est\u00e1 regentado por los propios vecinos, gente a la que le importa el lugar donde vive, que conoce a sus clientes, que se preocupa por lo que sucede a su alrededor. El peque\u00f1o comercio contribuye a humanizar las ciudades, ofrece un trato m\u00e1s cercano y dinamiza la econom\u00eda local, permitiendo a muchos vecinos ganarse la vida dignamente a la vez que proporcionan un necesario servicio a la comunidad. Cuando gastamos dinero en un comercio local, el beneficio no se volatiliza en tan gran medida hacia manos lejanas (y ya demasiado llenas) sino que permanece en nuestro entorno, volviendo de nuevo al circuito y generando m\u00e1s riqueza y bienestar. En un pueblo o barrio con un tejido comercial sano, las calles son m\u00e1s seguras, la vida m\u00e1s agradable, el ambiente m\u00e1s feliz. Si escogemos bien, podemos encontrar productos de gran calidad a precios razonables y el consejo experto de aquel tendero que acumula a\u00f1os de valiosa experiencia en su sector. Es posible, tambi\u00e9n, que nos sea m\u00e1s f\u00e1cil averiguar el origen de los productos que compramos o de las materias primas con las que se ha fabricado. A menudo, el peque\u00f1o comerciante utiliza redes de proximidad: el carnicero que se abastece en una granja de la provincia que es de su confianza, el frutero que compra a la cooperativa, el pescadero que va a la subasta de la lonja\u2026 Dentro del comercio local nos ser\u00e1 tambi\u00e9n m\u00e1s f\u00e1cil encontrar establecimientos que apoyen a artesanos y creadores; incluso puede que estemos ayudando a que se conserven muchos oficios tradicionales. As\u00ed, no solo estamos influyendo en la fisonom\u00eda de nuestro entorno m\u00e1s cercano sino tambi\u00e9n en el tipo de sociedad que se va configurando en nuestra comarca, en nuestro pa\u00eds. #YoComproenLA #Almuniadecine #comerciosdecine #elpeque\u00f1ocomerciotehacegrande","post_id":"399542463434098_1066494676738870","created_time":1462899004,"link":"https://scontent.fmad3-1.fna.fbcdn.net/v/t1.0-9/13177948_1066494676738870_5411418459211447478_n.jpg?oh=1472e905aad757091c3ba3ccf0bd7b09&oe=57D92F88","item":"photo","sender_name":"Delia Relancio Adiego"}}],"time":1462899209}]}',
